description:
Hell is for heroes handlar om en hopplos utslagen armegrupp, 
det ar host 1944, och nazistyrkorna langs Siegfriedlinjen ar helt 
overlagsna, men en grupp varnpliktiga skall lura tyskarna att de 
ar en mycket storre armegrupp och sla sig genom tyskarnas linjer,
men skall de lyckas...
Med bl.a. Steve McQueen, Bobby Darin, Fess Parker och James Coburn.

Filmen ar i svar/vitt och har inbrand svensk text.
